import React from "react";
import propTypes from "prop-types";

import * as Styled from "./style";

export const Type = {
  bg: "background",
  img: "image",
};

const Image = ({ className = "", src, type = Type.img }) => {
  const srcPath = "/assets/images/" + src;

  return (
    <>
      {type === Type.img ? (
        // <Styled.Image src={srcPath> />
        <img className={className} src={srcPath} />
      ) : (
        <Styled.Background
          className={className}
          src={srcPath}
        ></Styled.Background>
      )}
    </>
  );
};

Image.propTypes = {
  className: propTypes.string,
  src: propTypes.string.isRequired,
  type: propTypes.string,
};

export default Image;
